2.hymnText:
All hail the pow'r of Jesus' name! Let angels prostrate fall;
Bring forth the royal diadem, And crown Him Lord of all;
Bring forth the royal diadem, And crown Him Lord of all.



Ye chosen seed of Israel's race, A remnant weak and small,
Hail Him who saves you by His grace, And crown Him Lord of all;
Hail Him who saves you by His grace, And crown Him Lord of all.


Ye Gentile sinners, ne'er forget The wormwood and the gall;
Go, spread your trophies at His feet, And crown Him Lord of all;
Go, spread your trophies at His feet, And crown Him Lord of all.


Let ev'ry kindred, ev'ry tribe On this terrestrial ball,
To Him all majesty ascribe, And crown Him Lord of all;
To Him all majesty ascribe, And crown Him Lord of all.


O that with yonder sacred throng, We at His feet may fall;
We'll join the everlasting song, And crown Him Lord of all;
We'll join the everlasting song, And crown Him Lord of all.

15.hymnText:
We gather together to ask the Lord's blessing;

He chastens and hastens His will to make known;

The wicked oppressing now cease from distressing,

Sing praises to His name; He forgets not His own.



Beside us to guide us, our God with us joining,

Ordaining, maintaining His kingdom divine;

So from the beginning the fight we were winning,

Thou, Lord, wast at our side, all glory be Thine.



We all do extol Thee, Thou Leader triumphant,

And pray that Thou still our Defender wilt be;

Let Thy congregation escape tribulation,

Thy name be ever praised! O Lord, make us free.

Amen.

16.hymnText:
As we go up to worship here,
Sometimes in deep distress;
We look to God to calm our fear,
And fill our souls with rest.

Our hearts sometimes so empty feel,
The cross appears so great;
Before His throne we humbly kneel;
Oh, what a great retreat!

O, grant to us, most gracious Lord,
Thy blessed truths to hear;
To see the beauty of Thy word;
And feel Thy presence near.

Sometimes the light is from us drawn,
And we go down in grief;
Ere long He makes His presence known;
And brings us sweet relief.

O, could we know our Master's will,
And walk in duty's way;
He'll surely come our cups to fill,
And that without delay.

17.hymnText:
I love to see the Lord below,
His church displays His grace;
But upper worlds His glory know,
And view Him face to face.

I love to worship at His feet,
Tho' sin annoy me there;
But saints exalted near His seat
Have no assaults to fear.

I love to meet Him in His courts,
And taste His heav'nly love;
But still His visits seem too short,
Or I too soon remove.

O Lord, I love Thy service now;
Thy church displays Thy pow'r;
But soon in heav'n I'll to Thee bow,
And praise Thee evermore.

22.hymnText:
My Jesus, I love Thee, I know Thou art mine,

For Thee all the follies of sin I resign;

My gracious Redeemer, my Savior art Thou;

If ever I loved Thee, my Jesus, 'tis now.



I love Thee because Thou hast first loved me,

And purchased my pardon on Calvary's tree;

I love Thee for wearing the thorns on Thy brow;

If ever I loved Thee, my Jesus, 'tis now.



I'll love Thee in life, I will love Thee in death,

And praise Thee as long as Thou lendest me breath;

And say when the deathdew lies cold on my brow,

If ever I loved Thee, my Jesus, 'tis now.


In mansions of glory and endless delight,

I'll ever adore Thee in heaven so bright;

I'll sing with the glittering crown on my brow;

If ever I loved Thee, my Jesus, 'tis now.

28.hymnText:
In Thy great name, O Lord, we come
To worship at Thy feet;
Oh, pour Thy Holy Spirit down
On all that now shall meet.

We come to hear Jehovah speak,
To hear the Savior's voice;
Thy face and favor, Lord, we seek;
Now make our hearts rejoice.

Teach us to pray, and praise, and hear,
And understand Thy word;
To feel Thy blissful presence near,
And trust our living Lord.


Let sinners now Thy goodness prove,
And saints rejoice in Thee;
Let rebels be subdued by love,
And to the Savior flee.

30.hymnText:
Hark! Ten thousand harps and voices Sound the notes of praise above;
Jesus reigns, and heav'n rejoices, Jesus reigns, the God of love;
See, He sits on yonder throne; Jesus rules the world alone;
Hallelujah! Hallelujah! Jesus rules the world alone.


Jesus, hail! Whose glory brightens All above, and gives it worth;
Lord of life, Thy smile enlightens, Cheers, and charms Thy saints on earth;
When we think of love like Thine, Lord, we own it love divine;
Hallelujah! Hallelujah! Lord, we own it love divine.


King of glory, reign forever, Thine an everlasting crown;
Nothing from Thy love can sever, Those whom Thou hast made Thine own;
Happy objects of Thy grace, Destined to behold Thy face.
Hallelujah! Hallelujah! Destined to behold Thy face.


Savior, hasten Thine appearing, Bring, O bring the glor'ous day
When the awful summons hearing, Heav'n and earth shall pass away;
Then with golden harps we'll sing, "Glory, glory to our King!"
Hallelujah! Hallelujah! "Glory, glory to our King!"

















See, He sits on yonder throne; Jesus rules the world alone;

36.hymnText:
Ye servants of God, your Master proclaim,
And publish abroad His wonderful name;
The name allvictor'ous of Jesus extol;
His kingdom is glor'ous, He rules over all.


God ruleth on high, almighty to save;
And still He is nigh, His presence we have;
The great congregation His triumph shall sing,
Ascribing salvation to Jesus our King.


Salvation to God who sits on the throne,
Let all sing aloud and honor the Son;
The praises of Jesus the angels proclaim,
Fall down on their faces and worship the Lamb.


Then let us adore and give Him His right,
All glory and pow'r and wisdom and might;
All honor and blessing, with angels above,
And thanks never ceasing, and infinite love.

Amen.

47.hymnText:
More about Jesus would I know,
More of His grace to others show;
More of His saving fullness see,
More of His love who died for me.

More about Jesus let me learn,
More of His holy will discern;
Spirit of God, my teacher be,
Showing the things of Christ to me.

More about Jesus in His word,
Holding communion with my Lord;
Hearing His voice in ev'ry line,
Making each faithful saying mine.


More about Jesus on His throne,
Riches in glory all His own;
More of His kingdom's sure increase;
More of His coming, Prince of Peace.


More, more about Jesus,
More, more about Jesus;
More of His saving fullness see,
More of His love who died for me.

66.hymnText:
Praise the Lord; let all creation Praise the One who is our Light;
Sun and moon and stars together, Glorify Him day and night;
Praise the Lord, for He has given Us the mind of voice and song;
Let us tune ourselves together, Join with all the bloodbo't throng.

Praise the Savior for salvation, When He bled from spear and nail;
When He yielded up His spirit, When did split the temple veil;
Oh, how heavy was the burden Of the cross up Calv'ry's trail;
Praise the Lord, for He is faithful; Never shall His promise fail.

How can I begin to thank Him For the life He gave to me?
Give me grace to live more godly, Christ in me let others see;
Lord, I want to spend my talent Serving You in deed and word;
Hallelujah, what a Savior! Hallelujah, praise the Lord!

76.hymnText:
For the beauty of the earth, For the glory of the skies,
For the love which from our birth Over and around us lies;
Christ, Our God, to Thee we raise This our hymn of grateful praise.


For the wonder of each hour Of the day and of the night,
Hill and vale, and tree and flow'r, Sun and moon, and stars of light;
Christ, Our God, to Thee we raise This our hymn of grateful praise.


For the joy of human love, Brother, sister, parent, child,
Friends on earth, and friends above, For all gentle tho'ts and mild;
Christ, Our God, to Thee we raise This our hymn of grateful praise.


For Thy Church that evermore Lifteth holy hands above,
Off'ring up on ev'ry shore Her pure sacrifice of love;
Christ, Our God, to Thee we raise This our hymn of grateful praise.

104.hymnText:
Come, ye thankful people, come, Raise the song of harvest home;
All is safely gathered in, Ere the winter storms begin;
God, our Maker, doth provide For our wants to be supplied;
Come to God's own temple, come, Raise the song of harvest home.


All the world is God's own field, Fruit unto His praise to yield;
Wheat and tares together sown, Unto joy or sorrow grown;
First the blade, and then the ear, Then the full corn shall appear;
Lord of harvest, grant that we Wholesome grain and pure may be.


For the Lord our God shall come, And shall take His harvest home;
From His field shall in that day All offenses purge away,;
Give His angels charge at last In the fire the tares to cast;
But the fruitful ears to store In His garner evermore.


Even so, Lord, quickly come, To Thy final harvest home;
Gather Thou Thy people in, Free from sorrow, free from sin;
There, forever purified, In Thy presence to abide;
Come, with all Thine angels, come, Raise the glor'ous harvest home.

110.hymnText:
O help us, Lord! Each hour of need, Thy heav'nly succor give;
Help us in tho't and word and deed, Each hour on earth we live!
O help us when our spirits bleed With contrite anguish sore;
And when our hearts are cold and dead, O help us, Lord, the more!


O help us, thru the pray'r of faith, More firmly to believe;
For still the more the servant hath, The more shall he receive.
If strangers to Thy fold we call, Imploring at Thy feet
The crumbs that from Thy table fall, 'Tis all we dare entreat.


But be it, Lord of mercy, all, So Thou wilt grant but this;
The crumbs that from Thy table fall Are light and life and bliss.
O help us, Jesus, from on high; We know no help but Thee;
O help us, so to live and die, As Thine in heav'n to be!

118.hymnText:
Come, ye sinners, poor and needy,
Weak and wounded, sick and sore;
Jesus ready stands to help you,
Full of pity, love and pow'r.


Now, ye needy, come and welcome;
God's free bounty glorify;
True belief and true repentance,
Ev'ry grace that brings you nigh.


Let not conscience make you linger,
Nor of fitness fondly dream;
All the fitness He requireth
Is to feel your need of Him.


Come, ye weary, heavy laden,
Bruised and mangled by the fall;
If you tarry till you're better,
You will never come at all.

I will arise and go to Jesus,
He will embrace me in His arms;
In the arms of my dear Savior,
O there are ten thousand charms!

157.hymnText:
Hark! the voice of love and mercy Sounds aloud from Calvary;
See, it rends the rocks asunder, Shakes the earth, and veils the sky!
"It is finished, it is finished," Hear the dying Savior cry,
"It is finished, it is finished," Hear the dying Savior cry.



It is finished, O what pleasure Do these charming words afford!
Heav'nly blessings without measure Flow to us from Christ the Lord;
"It is finished, it is finished," Saints the dying words record,
"It is finished, it is finished," Saints the dying words record.


Finished, all the types and shadows Of the ceremonial law!
Finished, all that God has promised, Death and hell no more shall awe;
"It is finished, it is finished," Saints, from hence your comforts draw,
"It is finished, it is finished," Saints, from hence your comforts draw.


Happy souls, approach the table, Taste the soulreviving food;
Nothing half so sweet and pleasant As the Savior's flesh and blood;
"It is finished, it is finished," Christ has borne the heavy load,
"It is finished, it is finished," Christ has borne the heavy load.


Tune your harps anew, ye seraphs, Join to sing the pleasing theme;
All on earth and all in heaven Join to praise Emmanuel's name!
Hallelujah! hallelujah! Glory to the bleeding Lamb,
Hallelujah! hallelujah! Glory to the bleeding Lamb.

161.hymnText:
One day when heaven was filled with His praises,
One day when sin was as black as could be,
Jesus came forth to be born of a virgin
Dwelt amongst men, my example is He!


One day they led Him up Calvary's mountain,
One day they nailed Him to die on the tree;
Suffering anguish, despised and rejected;
Bearing our sins, my Redeemer is He!


One day they left Him alone in the garden,
One day He rested, from suffering free;
Angels came down o'er His tomb to keep vigil;
Hope of the hopeless, my Savior is He!


One day the grave could conceal Him no longer,
One day the stone rolled away from the door;
Then He arose, over death He had conquered;
Now is ascended, my Lord evermore!


One day the trumpet will sound for His coming,
One day the skies with His glories will shine;
Wonderful day, my beloved ones bringing;
Glorious Savior, this Jesus is mine!




Living, He loved me; dying, He saved me;
Buried He carried my sins far away;
Rising, He justified freely forever;
One day He's coming O glorious day!

164.hymnText:
What wondrous love is this, O my soul! O my soul!
What wondrous love is this, O my soul!
What wondrous love is this
That caused the Lord of bliss
To bear the dreadful curse for my soul, for my soul!
To bear the dreadful curse for my soul!


When I was sinking down, sinking down, sinking down;
When I was sinking down, sinking down;
When I was sinking down
Beneath God's righteous frown,
Christ laid aside His crown for my soul, for my soul!
Christ laid aside His crown for my soul!


Ye winged seraphs fly, bear the news, bear the news;
Ye winged seraphs fly, bear the news;
Ye winged seraphs fly,
Like comets thru the sky,
Fill vast eternity with the news, with the news;
Fill vast eternity with the news.


To God and to the Lamb I will sing, I will sing;
To God and to the Lamb I will sing;
To God and to the Lamb,
Jehovah, great I AM;
While millions join the theme, I will sing, I will sing,
While millions join the theme, I will sing.


Ye friends of Zion's King, join the praise, join the praise;
Ye friends of Zion's King, join the praise;
Ye friends of Zion's King,
With harps and voices sing,
And strike each tuneful string in His praise, in His praise;
And strike each tuneful string in His praise.

186.hymnText:
Sometimes a light surprises The Christian while he sings;
It is the Lord who rises With healing in His wings;
When comforts are declining, He grants the soul again
A season of clear shining To cheer it after rain.


In holy contemplation, We sweetly then pursue
The theme of God's salvation, And find it ever new;
Set free from present sorrow, We cheerfully can say,
E'en let the unknown morrow Bring with it what it may.


It can bring with it nothing, But He will bear us thru;
Who gives the lilies clothing, Will clothe His people, too;
Beneath the spreading heavens No creature but is fed;
And He who feeds the ravens Will give His children bread.


Tho' vine nor fig tree neither Their wonted fruit shall bear,
Tho' all the field should wither, Nor flocks nor herds be there,
Yet God the same abiding, His praise shall tune my voice;
For while in Him confiding, I cannot but rejoice.






Oh, had I wings I would fly away and be at rest,
And I'd praise God in His bright abode.

199.hymnText:
Holy Bible, book divine,
Precious treasure, thou art mine;
Mine to tell me whence I came;
Mine to teach me what I am;

Mine to chide me when I rove;
Mine to show a Savior's love;
Mine thou art to guide and guard;
Mine to punish or reward;

Mine to comfort in distress,
Suff'ring in this wilderness;
Mine to show, by living faith,
Man can triumph over death;

Mine to tell of joys to come,
And the rebel sinner's doom;
O thou holy book divine,
Precious treasure, thou art mine.

Amen.

203.hymnText:
Jesus is our great salvation,
Worthy of our best esteem;
He has saved His fav'rite nation,
Christ alone could us redeem.


When involved in sin and ruin,
And no helper there was found,
Jesus our distress was viewing;
Grace did more than sin abound.



Free election, known by calling,
Is a privilege divine;
Saints are kept from final falling;
All the glory, Lord, is Thine.


Let us never, Lord, forget Thee;
Make us walk as children here;
We will give Thee all the glory,
And rejoice with holy fear.

209.hymnText:
Watchman, tell me does the morning
Of fair Zion's glory dawn?
Have the signs that mark His coming
Yet upon thy pathway shone?
Pilgrim, rise and look around thee;
Light is breaking in the skies;
D.C.Gird thy bridal robes around thee,
Morning dawns; arise, arise.


Watchman, see the light is beaming,
Brighter still upon the way;
Signs thru all the earth are gleaming,
Omens of the coming day;
Then the jubal trumpet sounding,
Shall awake from earth and sea;
D.C.All the saints of earth now sleeping,
Clad in immortality.


See them rising up to meet Him,
As He comes down from on high,
Oh, how happy now to greet Him,
And to heav'n they with Him fly;
See the pearly gates fly open,
Oh, how sweetly now they sing;
D.C.All the heav'nly arches ringing
With the praise of God, their King.



Have the signs that mark His coming
Yet upon thy pathway shone?
Signs thru all the earth are gleaming,
Omens of the coming day;
Oh, how happy now to greet Him,
And to heav'n they with Him fly;

226.hymnText:
Out on the ocean all boundless we ride, We're homeward bound, homeward bound;
Tossed on the waves of a rough, restless tide, We're homeward bound, homeward bound;
Far from the safe, quiet harbor we rode, Far from our Father's celestial abode,
Promise of which on us He hath bestowed, We're homeward bound, homeward bound. 


Wildly the storm sweeps us on as it roars, We're homeward bound, homeward bound;
Look! yonder lie the bright heavenly shores, We're homeward bound, homeward bound;
Fear not, the Pilot stands firm at the wheel; Fear not, we soon shall outweather the gale;
Oh, how we fly 'neath the loud creaking sail, We're homeward bound, homeward bound. 


We'll tell the saints as we journey along, We're homeward bound, homeward bound;
Try to persuade them to join in our song, We're homeward bound, homeward bound;
Come, trembling pilgrim, forlorn and oppressed, Join in our number;
Oh, come and find rest; Journey with us in the way of the blest; We're homeward bound, homeward bound. 


Into the harbor of heav'n  now we glide, We're homeward bound, homeward bound;
Softly we drift on its bright silver tide, We're homeward bound, homeward bound;
Glory to God! all our sorrows are o'er, We stand secure on the glorified shore;
Glory to God, we will shout evermore, We're home at last, home at  last.

230.hymnText:
If you have friends in gloryland Who've left because of pain;
There'll be no pain in gloryland, They'll suffer not again.

The lame in gloryland will walk, The blind up there will see;
The deaf in gloryland will hear, The dumb will talk to me.


There'll be no sun in gloryland, The moon and stars won't shine:
For Christ Himself is light up there. We'll live on love divine.




If you have friends in gloryland Who've left because of pain;
There'll be no pain in gloryland, They'll suffer not again.


So weep not friends, I'm going home. Up there we'll die no more.
No coffins will be made up there, No graves on that bright shore.

237.hymnText:
Lord, I believe; Thy pow'r I own,
Thy Word I would obey;
I wander comfortless and lone
When from Thy truth I stray.




Lord, I believe; but gloomy fears
Sometimes bedim my sight;
I look to Thee with pray'rs and tears,
And cry for strength and light.


Lord, I believe; but oft I know,
My faith is cold and weak;
My weakness strengthen, and bestow
The confidence I seek.


Yes, I believe; and only Thou
Canst give my soul relief;
Lord, to Thy truth my spirit bow;
"Help Thou my unbelief!"

238.hymnText:
A glor'ous rest is promised, a home forever bright;
Where clouds shall never gather, a home where is no night.


There palms and crowns await us, and robes of spotless white;
But best of all, a heaven, a home where is no night.


When loosed from earthly trials, the spirit takes its flight;
To dwell in realms of glory, where Jesus is the light.



No night, no night,
But eternal day is giv'n;
No night, no night,
There will be no night in heav'n.

No night, no night, No night, no night,

255.hymnText:
Great is Thy faithfulness, O God my Father;
There is no shadow of turning with Thee;
Thou changest not, thy compassions, they fail not;
As Thou hast been Thou forever wilt be.


Summer and winter and springtime and harvest,
Sun, moon, and stars in their courses above
Join with all nature in manifold witness
To Thy great faithfulness, mercy, and love.


Pardon for sin and a peace that endureth,
Thine own dear presence to cheer and to guide;
Strength for today and bright hope for tomorrow,
Blessings all mine, with ten thousand beside!








Great is Thy faithfulness!
Great is Thy faithfulness!
Morning by morning new mercies I see;
All I have needed Thy hand hath provided;
Great is Thy faithfulness, Lord, unto me!

262.hymnText:
Dear child of God, dost thou not know, That thou shalt reap what thou dost sow?
If to thy flesh thou sow'st thy fields, Corruption is the fruit that yields.


And if thou sparingly shalt sow, Then sparingly thy fruit shall grow;
But if abundant seeds are sown, Abundant fruit shall then be grown.


May Jesus help thee sow good seed, In all thy tho'ts and words and deeds;
And thou shalt find in harvest days, It shall return in num'rous ways.

266.hymnText:
God's love has meant so much to me,
I want to praise His holy name,
His grace and truth have set me free,
This blessed truth I would proclaim.
He is my hope, my strength and guide,
His Spirit does my soul inspire;
For me He bled and groaned and died;
Christ is the Savior I desire.




This Savior is our living bread
Our wisdom and our righteousness,
We eat His flesh, we drink His blood;
He is the source of all our bliss.
He feeds my soul on things above,
And warms me with His sacred fire;
I want to feel His grace and love;
Christ is the portion I desire.



He is my sun to give me light,
In Him my spirit shall be blessed;
His grace will bring supreme delight,
And give to me eternal rest.
Without His mercies I would fall,
So for His way I should inquire;
I find in Him my all in all;
Christ is the treasure I desire.

275.hymnText:
Have faith in God when your pathway is lonely,
He sees and knows all the way you have trod;
Never alone are the least of His children,
Have faith in God, have faith in God.


Have faith in God when your prayers are unanswered,
Your earnest plea He will never forget;
Wait on the Lord, trust His word and be patient,
Have faith in God, He'll answer yet.


Have faith in God in your pain and your sorrow,
His heart is touched with your grief and despair;
Cast all your cares and your burdens upon Him,
And leave them there, oh, leave them there.


Have faith in God tho all else fail about you;
Have faith in God, He provides for His own;
He cannot fail tho all kingdoms shall perish,
He rules, He reigns upon His throne.






Have faith in God, He's on His throne,
Have faith in God, He watches o'er His own;
He cannot fail; He must prevail,
Have faith in God, have faith in God.

292.hymnText:
I must tell Jesus all of my trials;
I cannot bear these burdens alone;
In my distress He kindly will help me;
He ever loves and cares for His own.


I must tell Jesus all of my troubles;
He is a kind, compassionate Friend;
If I but ask Him, He will deliver,
Make of my troubles quickly an end.


Tempted and tried, I need a great Savior,
One who can help my burdens to bear;
I must tell Jesus, I must tell Jesus;
He all my cares and sorrows will share.


O how the world to evil allures me!
O how my heart is tempted to sin!
I must tell Jesus, and He will help me,
Over the world the vict'ry to win.






I must tell Jesus! I must tell Jesus!
I cannot bear my burdens alone;
I must tell Jesus! I must tell Jesus!
Jesus can help me, Jesus alone!

300.hymnText:
Be Thou my vision,
O Lord of my heart;
Naught be all else to me, save that Thou art;
Thou my best thought, by day or by night,
Waking or sleeping, Thy presence my light.





Be Thou my wisdom,
And Thou my true Word;
I ever with Thee and Thou with me, Lord;
Thou my great Father, I Thy true Son;
Thou in me dwelling, and I with Thee one.


Riches I heed not,
Nor man's empty praise;
Thou mine inheritance, now and always;
Thou and Thou only, first in my heart,
High King of Heaven, my treasure Thou art.


High King of Heaven,
My victory won;
May I reach Heaven's joys, bright Heaven's Sun!
Heart of my own heart, whatever befall,
Still be my vision, O Ruler of all.

304.hymnText:
I need Thee ev'ry hour,
Most gracious Lord;
No tender voice like Thine
Can peace afford.



I need Thee ev'ry hour,
Stay Thou near by;
Temptations lose their pow'r
When Thou art nigh.


I need Thee ev'ry hour,
In joy or pain;
Come quickly and abide,
Or life is vain.


I need Thee ev'ry hour,
Most Holy One;
O make me Thine indeed,
Thou blessed Son.


I need Thee, O I need Thee;
Ev'ry hour I need Thee;
O bless me now, my Savior!
I come to Thee.

308.hymnText:
With Jesus I would ever be,
His matchless name adore;
He's done so very much for me,
I want to love Him more.


He died upon the cruel tree,
Our load of guilt He bore;
He suffered shame for you and me,
I want to love Him more.


His children He will not forsake
When troubles press them sore;
But in their souls sweet peace awakes;
I want to love Him more.


O Prince of life, sweet Prince of peace,
Who dwelt on earth below!
My faith in Him will never cease;
I want to love Him more.


I want to love Him more,
I want to love Him more,
I want to love Him more,
I do, I do, I do;
I want to love Him more,
I want to love Him more;
He's done so much for me.

313.hymnText:
More holiness give me,
More strivings within;
More patience in suff'ring,
More sorrow for sin;
More faith in my Savior,
More sense of His care;
More joy in His service,
More purpose in prayer.


More gratitude give me,
More trust in the Lord;
More pride in His glory,
More hope in His Word;
More tears for His sorrows,
More pain at His grief;
More meekness in trial,
More praise for relief.



More purity give me,
More strength to o'ercome;
More freedom from earth stains,
More longings for home;
More fit for the kingdom,
More useful I'd be;
More blessed and holy,
More, Savior, like Thee.

321.hymnText:
Lord, how sweet 'tis to see the dear ones follow Thee
In a service of love here below;
There's no tongue can portray the sweet peace of this way,
And the blessing you do here bestow.


Such a peace, we are told, is more precious than gold,
For their treasures are laid up above;
With the saints they live high, and on Christ they rely,
As they feast on His blessings of love.


Now, dear children, we wish you to share in this bliss,
As you go bear the yoke and the cross;
Yoke is soft, burden light, follow Him with delight,
For with Jesus no service is lost.


Quiet peace comes the day that you start in this way;
Rest is found all the journey along;
Rest in peace and at home, why not then to Him come,
Praise the Lord in your deeds and your song?


Then the sorrows and tears that shall come later years,
All are made easy for you to bear;
So then why will you roam from this dear, peaceful home,
And no joys with the saints here to share?

329.hymnText:
Spirit of God, descend upon my heart;
Wean it from earth, thru all its pulses move;
Stoop to my weakness, mighty as Thou art,
And make me love Thee as I ought to love.


Hast Thou not bid us love Thee, God and King?
All, all Thine own, soul, heart and strength and mind;
I see Thy cross, there teach my heart to cling;
O let me seek Thee, and O let me find.


Teach me to feel that Thou art always nigh;
Teach me the struggles of the soul to bear,
To check the rising doubt, the rebel sigh;
Teach me the patience of unanswered prayer.


Teach me to love Thee as Thine angels love,
One holy passion filling all my frame;
The baptism of the heav'n-descended Dove,
My heart an altar, and Thy love the flame.

335.hymnText:
Thus far the Lord has led me on;
Thus far His pow'r prolongs my days;
And ev'ry ev'ning shall make known
Some fresh memorials of His grace.


Much of my time has run to waste,
And I perhaps am near my home;
But He forgives my follies past;
He gives me strength for days to come.


In vain the sons of earth or hell
Tell me a thousand frightful things;
My God in safety makes me dwell
Beneath the shadow of His wings.


I lay my body down to sleep;
Peace is the pillow for my head;
While well-appointed angels keep
Their watchful stations 'round my bed.

340.hymnText:
Oh, beautiful Star of Bethlehem, shining afar thru shadows dim,
Giving a light for those who long have gone;
And guiding the wise men on their way unto the place where Jesus lay,

Oh, beautiful Star, the hope of light, guiding the pilgrim thru the night,
Over the mountain till the break of dawn;
And into the light of perfect day it will give out a lovely ray,
Beautiful Star of Bethlehem, shine on.


Oh, beautiful Star, the hope of rest, for the redeemed, the good and blest,
Yonder in glory when the crown is won;
For Jesus is now that Star divine, brighter and brighter He will shine,


Oh, beautiful Star of Bethlehem, Shine upon us until the glory dawn;

Oh, give us Thy light to light the way into the land of perfect day,
Beautiful Star of Bethlehem, shine on.

Beautiful, beautiful Star, Star of Bethlehem, glory dawn;

351.hymnText:
Hover o'er me, Holy Spirit,
Bathe my trembling heart and brow;
Fill me with Thy hallowed presence,
Come, O come and fill me now.


Thou canst fill me, gracious Spirit,
Tho' I cannot tell Thee how;
But I need Thee, greatly need Thee,
Come O come and fill me now.


I am weakness, full of weakness;
At Thy sacred feet I bow;
Blest divine, eternal Spirit,
Fill with pow'r, and fill me now.


Cleanse and comfort, bless and save me;
Bathe, o bathe my heart and brow!
Thou art comforting and saving,
Thou art sweetly filling now.


Fill me now, fill me now,
Jesus, come and fill me now;
Fill me with Thy hallowed presence,
Come, O come and fill me now.

357.hymnText:
Savior, like a shepherd lead us,
Much we need Thy tender care;
In Thy pleasant pastures feed us,
For our use Thy folds prepare;
Blessed Jesus, blessed Jesus,
Thou hast bought us, Thine we are;
Blessed Jesus, blessed Jesus,
Thou hast bought us, Thine we are.

We are Thine; do Thou befriend us,
Be the Guardian of our way;
Keep Thy flock, from sin defend us,
Seek us when we go astray;
Blessed Jesus, blessed Jesus,
Hear, O hear us when we pray,
Blessed Jesus, blessed Jesus,
Hear, O hear us when we pray.


Thou hast promised to receive us,
Poor and sinful tho' we be;
Thou hast mercy to relieve us,
Grace to cleanse and pow'r to free;
Blessed Jesus, blessed Jesus,
Early let us turn to Thee,
Blessed Jesus, blessed Jesus,
Early let us turn to Thee.


Early let us seek Thy favor;
Early let us do Thy will;
Blessed Lord and only Savior,
With Thy love our bosoms fill;
Blessed Jesus, blessed Jesus,
Thou hast loved us, love us still,
Blessed Jesus, blessed Jesus,
Thou hast loved us, love us still.

370.hymnText:
Abide with me; fast falls the eventide;
The darkness deepens; Lord, with me abide;
When other helpers fail, and comforts flee,
Help of the helpless, O abide with me!


Swift to its close ebbs out life's little day;
Earth's joys grow dim, its glories pass away;
Change and decay in all around I see;
O Thou who changest not, abide with me!



I need Thy presence ev'ry passing hour;
What but Thy grace can foil the tempter's pow'r?
Who like Thyself my guide and stay can be?
Thru cloud and sunshine, O abide with me!


Hold Thou Thy word before my closing eyes;
Shine thru the gloom, and point me to the skies;
Heav'n's morning breaks, and earth's vain shadows flee;
In life, in death, O Lord, abide with me!

408.hymnText:
O, tell me no more of this world's vain store, 
The time for such trifles with me now is o'er; 
A country I've found where true joys abound; 
To dwell I'm determined on that happy ground.  


No mortal will know what Christ will bestow, 
What joy, strength, and comfort do after Him go; 
Lo! onward I move to see Christ above; 
None guesses how wondrous my journey will prove.  


Great spoils I shall win from death, hell, and sin, 
'Midst outward affliction shall feel Christ within; 
And still, which is best, I in  His dear breast, 
As at the beginning, find pardon and rest.  


When I am to die, receive me, I'll cry, 
For Jesus has loved me, I cannot tell why; 
But this I do find: we two are so joined, 
He'll not live in glory and leave me behind.   


This blessing is mine thru favor divine, 
And, O, my dear Jesus, the praise shall be Thine; 
In heaven we'll meet in harmony sweet, 
And glory to Jesus! we'll then be complete.

409.hymnText:
Mixtures of joy and sorrow
I daily do pass thru;
Sometimes I'm in the valley,
And sinking down with woe;
Sometimes I am exalted,
On eagle's wings I fly;
I rise above my troubles,
And hope to reach the sky.


Sometimes I'm full of doubting,
And think I have no grace;
Sometimes I'm full of praising,
When Christ reveals His face;
Sometimes my hope's so little,
I think I'll throw it by;
Sometimes it seems sufficient,
If I were called to die.


Sometimes I shun the Christian,
Lest he should talk to me;
Sometimes he is the neighbor
I long the most to see;
Sometimes we meet together,
The season's dry and dull;
Sometimes we find a blessing;
With joy it fills my soul.


Sometimes I travel mourning
Down Babel's ancient stream;
Sometimes my Lord's religion
Appears my only theme;
Sometimes when I am praying,
It seems almost a task;
Sometimes receive a blessing,
The greatest I can ask.

410.hymnText:
Tears flood my eyes, I cry to Thee, Incline Thine ear, I pray;
I mourn because my enemies cast down upon me hate.


Lord, is Your arm stretched out for me? Will You attend my cries?
I know I'm saved eternally, but here am I to die?


My heart is sore and pained within, o'erwhelmed and beaten down;
King, hear my cry, and let me see My heart is no more bound!


And even in my unbelief, Yet He in faith abides;
For His foundation standeth sure, Himself He can't deny!



Lord, I believe! Lord, I believe, help Thou mine unbelief;
I cry to Thee, Lord, I believe, help Thou mine unbelief!

414.hymnText:
Oh, my Lord, I am Thine; what a blessing divine;
What a comfort to feel Thou art near!
In the arms of Thy love I am carried above
Ev'ry sin and temptation and fear.


In the rapturous sound of Thy name I have found
Sweetest music my spirit can know;
With the light of Thy face and the charms of Thy grace
I have found a sweet heaven below.


This is only a taste of the heavenly feast
I shall find when my journey is o'er;
This sweet truth I shall prove when with joy I remove
To my home on the heavenly shore.




I will rest in Thy love, I will rest, sweetly rest in Thy love;
To Thy wings I will flee, I will shelter in Thee;
I will rest, sweetly rest in Thy love.

416.hymnText:
God sent His Son, they called Him Jesus;
He came to love, heal, and forgive;
He lived and died to buy my pardon,
An empty grave is there to prove my Savior lives.


How sweet to hold a newborn baby,
And feel the pride and joy he gives;
But greater still the calm assurance:
This child can face uncertain days because He lives.


And then one day I'll cross the river,
I'll fight life's final war with pain;
And then as death gives way to vict'ry,
I'll see the lights of glory, and I'll know He reigns.

Because He lives, I can face tomorrow,
Because He lives, all fear is gone;
Because I know He holds the future,
And life is worth the living just because He lives.

424.hymnText:
Jesus, lover of my soul,
Let me to Thy bosom fly,
While the nearer waters roll,
While the tempest still is high;
Hide me, O my Savior, hide,
Till the storm of life is past;
Safe into the haven guide;
O receive my soul at last.


Other refuge have I none;
Hangs my helpless soul on Thee;
Leave, O leave me not alone,
Still support and comfort me;
All my trust on Thee is stayed,
All my help from Thee I bring;
Cover my defenseless head
With the shadow of Thy wing.


Thou, O Christ, art all I want;
More than all in Thee I find;
Raise the fallen, cheer the faint,
Heal the sick, and lead the blind;
Just and holy is Thy name,
I am all unrighteousness;
False and full of sin I am,
Thou art full of truth and grace.


Plenteous grace with Thee is found,
Grace to cover all my sin;
Let the healing streams abound,
Make and keep me pure within;
Thou of life the fountain art,
Freely let me take of Thee;
Spring Thou up within my heart,
Rise to all eternity.

Amen.

427.hymnText:
When my way groweth drear, precious Lord, linger near,
When my life is almost gone;
Hear my cry, hear my call, hold my hand lest I fall;
Take my hand, precious Lord, lead me home.


When the shadows appear, and the night draweth near,
And the day is past and gone;
At the river I stand, guide my feet, hold my hand;
Take my hand, precious Lord, lead me home.

Precious Lord, take my hand, lead me on, let me stand,
I am tired, I am weak, I am worn,
Thru the storm, thru the night, lead me on to the light;
Take my hand, precious Lord, lead me home.

428.hymnText:
As I journey thru the land singing as I go,
Pointing souls to Calvary to the crimson flow,
Many arrows pierce my soul from without, within;
But my Lord leads me on, thru Him I must win.

When in service for my Lord dark may be the night,
But I'll cling more close to Him, He will give me light;
Satan's snares may vex my soul, turn my tho'ts aside;
But my Lord goes ahead, leads whate'er betide.


When before me billows rise from the mighty deep,
Then my Lord directs my bark; He doth safely keep,
And He leads me gently on thru this world below;
He's a real Friend to me, O I love Him so.

O I want to see Him, look upon His face;
There to sing forever of His saving grace;
On the streets of glory let me lift my voice;
Cares all past, home at last, ever to rejoice.

435.hymnText:
How tedious and tasteless the hours
When Jesus no longer I see!
Sweet prospects, sweet birds, and sweet flow'rs
Have all lost their sweetness to me.
The midsummer sun shines but dim;
The fields strive in vain to look gay;
But when I am happy in Him,
December's as pleasant as May.

His name yields the richest perfume,
And sweeter than music His voice;
His presence disperses my gloom
And makes all within me rejoice;
I should, were He always thus nigh,
Have nothing to wish or to fear;
No mortal so happy as I;
My summer would last all the year.


Content with beholding His face,
My all to His pleasure resigned,
No changes of season or place
Would make any change in my mind;
While blest with a sense of His love,
A palace a toy would appear;
And prisons would palaces prove,
If Jesus would dwell with me there.


Dear Lord, if indeed I am Thine,
If Thou art my sun and my song,
Say, why do I languish and pine,
And why are my winters so long?
Oh, drive these dark clouds from my sky;
Thy soul-cheering presence restore;
Or take me unto Thee on high,
Where winter and clouds are no more.

438.hymnText:
Flee as a bird to your mountain,
Thou who art weary of sin;
Go to the clear flowing fountain,
Where you may wash and be clean.
Fly for th'Avenger is near thee;
Call and the Savior will hear thee;
He on His bosom will bear thee,
Thou who art weary of sin,
O, thou who art weary of sin.



He will protect thee forever,
Wipe ev'ry sad falling tear;
He will forsake thee, no, never,
Sheltered so tenderly there.
Haste, then, the hours fast are flying,
Spend not the moments in sighing;
Cease from your sorrow and crying;
The Savior will wipe ev'ry tear,
The Savior will wipe ev'ry tear.

442.hymnText:
Father, we rest in Thy love, Father, we rest in Thy love;
Father, we rest, Father, we rest, we rest in Thy love;
Father, we rest in Thy love, we rest, we rest in Thy love,
Father, we rest, we rest in Thy love.


Savior, we trust in Thy grace, Savior, we trust in Thy grace;
Savior, we trust, Savior, we trust, we trust in Thy grace;
Savior, we trust in Thy grace, we trust, we trust in Thy grace,
Savior, we trust, we trust in Thy grace.


Spirit, we pray for Thy pow'r, Spirit, we pray for Thy pow'r;
Spirit, we pray, Spirit, we pray, we pray for Thy pow'r;
Spirit, we pray for Thy pow'r, we pray, we pray for Thy pow'r,
Spirit, we pray, we pray for Thy pow'r.



Father, we rest, we rest, we rest in Thy 

Savior, we trust, we trust, we trust in Thy

Spirit, we pray, we pray, we pray for Thy

449.hymnText:
I know not what God has in store for me within His plan,
I do not fear because I know my life is in His hand;
I know not what tomorrow brings: sadness or bluer skies,
But I am sure I will not step beyond my Father's eyes.



I could not say if I will live another day or two;
But ev'ry day I'll thank Him for the morning that is new;
I do not want life's riches here, or jewels on my hands,
But what I want is God's pure love, where sweetness ever stands.


For God knows what is best for me; He keeps me in His care;
And tho' I travel near and far, His love is ev'rywhere;
I do not know what friends will say, whene'er the road gets rough,
But it's all right, for God loves me, and that is quite enough.

461.hymnText:
Great is the Lord our God,
And let His praise be great;
He makes His churches His abode,
His most delightful seat.


In Zion God is known,
A refuge in distress;
How bright has His salvation shown
Thru all her palaces.

When kings against her joined;
And saw the Lord was there;
In wild confusion of the mind,
They fled with hasty fear.

Oft have our fathers told,
Our eyes have often seen;
How well our God secures the fold
Where His own sheep have been.



In ev'ry new distress,
We'll to His house repair;
We'll call to mind His wondrous grace,
And seek deliv'rance there.

464.hymnText:
If the world from you withhold of its silver and its gold,
And you have to get along with meager fare;
Just remember in His word how He feeds the little bird;
Take your burden to the Lord and leave it there.


If your body suffers pain, and your health you can't regain,
And your soul is almost sinking in despair;
Jesus knows the pain you feel, He can save, and He can heal;
Take your burden to the Lord and leave it there.


When your enemies assail, and your heart begins to fail,
Don't forget that God in Heaven answers prayer;
He will make a way for you and will lead you safely thru;
Take your burden to the Lord and leave it there.


When your youthful days are gone, and old age is stealing on,
And your body bends beneath the weight of care;
He will never leave you then, He'll go with you to the end;
Take your burden to the Lord and leave it there.

Leave it there, leave it there,
Take your burden to the Lord and leave it there;
If you trust and never doubt, He will surely bring you out,
Take your D.S.burden to the Lord and leave it there.

 Leave it there, leave it there, 

 leave it there;

501.hymnText:
God be with you till we meet again,
By His counsels guide, uphold you,
With His sheep securely fold you;
God be with you till we meet again.

God be with you till we meet again, 
'Neath His wings securely hide you, 
Daily manna will provide you; 
God be with you till we meet again. 

God be with you till we meet again;
When life's perils thick confound you,
Put His arms unfailing round you;
God be with you till we meet again.


God be with you till we meet again;
Keep love's banner floating o'er you,
Smite death's threat'ning wave before you;
God be with you till we meet again.



Till we meet, till we meet,
Till we meet at Jesus' feet;
Till we meet, till we meet,
God be with you till we meet again. 

Till we meet, till we meet again, till we meet; Till we meet, till we meet again,
